/** 
 * @param realtimeMs Elapsed real-time as returned by {@code SystemClock.elapsedRealtime()} atthe time of the event, in milliseconds.
 * @param timeline Most recent {@link Timeline} that contains the event position.
 * @param windowIndex Window index in the {@code timeline} this event belongs to, or theprospective window index if the timeline is not yet known and empty.
 * @param mediaPeriodId {@link MediaPeriodId Media period identifier} for the media period thisevent belongs to, or  {@code null} if the event is not associated with a specific mediaperiod.
 * @param eventPlaybackPositionMs Position in the window or ad this event belongs to at the timeof the event, in milliseconds.
 * @param currentTimeline The current {@link Timeline} at the time of the event (equivalent to{@link Player#getCurrentTimeline()}).
 * @param currentWindowIndex The current window index in {@code currentTimeline} at the time ofthe event, or the prospective window index if the timeline is not yet known and empty (equivalent to  {@link Player#getCurrentWindowIndex()}).
 * @param currentMediaPeriodId {@link MediaPeriodId Media period identifier} for the currentlyplaying media period at the time of the event, or  {@code null} if no current media periodidentifier is available.
 * @param currentPlaybackPositionMs Position in the current timeline window or the currentlyplaying ad at the time of the event, in milliseconds.
 * @param totalBufferedDurationMs Total buffered duration from {@code currentPlaybackPositionMs}at the time of the event, in milliseconds. This includes pre-buffered data for subsequent ads and windows.
 */
public EventTime(long realtimeMs,Timeline timeline,int windowIndex,@Nullable MediaPeriodId mediaPeriodId,long eventPlaybackPositionMs,Timeline currentTimeline,int currentWindowIndex,@Nullable MediaPeriodId currentMediaPeriodId,long currentPlaybackPositionMs,long totalBufferedDurationMs){
  this.realtimeMs=realtimeMs;
  this.timeline=timeline;
  this.windowIndex=windowIndex;
  this.mediaPeriodId=mediaPeriodId;
  this.eventPlaybackPositionMs=eventPlaybackPositionMs;
  this.currentTimeline=currentTimeline;
  this.currentWindowIndex=currentWindowIndex;
  this.currentMediaPeriodId=currentMediaPeriodId;
  this.currentPlaybackPositionMs=currentPlaybackPositionMs;
  this.totalBufferedDurationMs=totalBufferedDurationMs;
}
